import React, { useEffect } from 'react';
import axios from '../../axios';
import '../../App.css';

const Products = () => {
	useEffect(() => {
		async function checkExistingUser() {
			const req = await axios.post('/user/login');
			if (req) {
				console.log(`req`, req);
			}
		}
		checkExistingUser();
	}, []);
	return <h1 className="products">PRODUCTS</h1>;
};
export default Products;
